import React from "react";
import SearchPopup from "./SearchPopup";
import SearchList from "./SearchList";

function SearchItem() {
  return (
    <div style={{ display: "flex", flexDirecter: "row" }}>
      <SearchPopup />
      <SearchList />
    </div>
  );
}
export default SearchItem;
